import React from 'react';

const Products = React.memo(props => {
  const { products } = props

  return (
    <div class="product-list">
      {
        products.map(product => {
        return (
          <div class="product">{product.productName}</div>
        )
      })
      }
    </div>
  );
});

export default Products;
